import { Row, Col } from "react-bootstrap";

import style from "../css/UserInfoModal.module.css";

const UserInfoModal = () => {
  return (
    <>
      <Row
        className={style["background"]}
        onClick={() => {
          alert("hi");
        }}
      >
        <Row className={style["modal"]}>
          <Row>로고</Row>
          <Row>로고 수정 버튼</Row>
          <Row>
            <Col>레벨</Col>
            <Col>승패</Col>
          </Row>
          <Row>
            <Col>
              <Row>구단명</Row>
            </Col>
            <Col>
              <Row>구단명 인풋</Row>
            </Col>
          </Row>
          <Row>
            <Col>
              <Row>SAVE</Row>
            </Col>
            <Col>
              <Row>BACK</Row>
            </Col>
          </Row>
          <Row>회원탈퇴하기</Row>
        </Row>
      </Row>
    </>
  );
};

export default UserInfoModal;
